DECLARE
	@SchemaName AS nvarchar(128) = 'dbo' -- All objects will be created in this schema
	,@Prefix AS nvarchar(128) = 'test_'; -- All objects will be prefixed with this in their name
SET NOCOUNT ON;
DECLARE @SQL AS nvarchar(4000);
SET @SQL = 'SELECT OBJECT_ID(''[' + @SchemaName + '].[' + @Prefix + 'Box]'')';
DECLARE @ObjectIDTable AS TABLE(ObjectID int);
INSERT INTO @ObjectIDTable
EXEC (@SQL);
IF (SELECT TOP 1 ObjectID FROM @ObjectIDTable) IS NOT NULL THROW 50000, 'Box table already exists. Did you already run bootstrap? You can execute the unpack procedure, or drop the Box table, or change schema or prefix', 1
IF OBJECT_ID('tempdb..#BoxTable') IS NOT NULL DROP TABLE #BoxTable
SELECT ObjectName,ObjectType,ObjectSequence,CAST('' AS xml).value('xs:base64Binary(sql:column("BinaryContent"))','varbinary(max)')BinaryContent,TextContent,DecimalContent,DateContent INTO #BoxTable FROM (VALUES
(N'AgentCategoryName','CONF',0,NULL,N'TacticalDQ',NULL,CAST(NULL AS datetimeoffset))
,(N'AgentConfig','CODE',40,'',NULL,NULL,NULL)
,(N'AgentIntervalMinutes','CONF',0,NULL,NULL,10.00000,NULL)
,(N'AgentJobName','CONF',0,NULL,N'TDQBatchNew',NULL,NULL)
,(N'BatchConfig','CODE',40,'',NULL,NULL,NULL)
,(N'BatchCurrent','CODE',42,'',NULL,NULL,NULL)
,(N'BatchNew','CODE',41,'',NULL,NULL,NULL)
,(N'BootstrapScript','CODE',100,'',NULL,NULL,NULL)
,(N'Box','TABL',0,'',NULL,NULL,NULL)
,(N'BoxDec','CODE',10,'',NULL,NULL,NULL)
,(N'BoxText','CODE',10,'',NULL,NULL,NULL)
,(N'Cases','TABL',1,'',NULL,NULL,NULL)
,(N'HomePrefix','CONF',0,NULL,N'alpha_',NULL,NULL)
,(N'HomeSchema','CONF',0,NULL,N'tdq',NULL,NULL)
,(N'Log','TABL',1,'',NULL,NULL,NULL)
,(N'MaxParallelMeasurements','CONF',0,NULL,NULL,5.00000,NULL)
,(N'measure_XX001','MESR',200,'',NULL,NULL,NULL)
,(N'measure_XX002','MESR',200,'',NULL,NULL,NULL)
,(N'Measurement','CODE',31,'',NULL,NULL,NULL)
,(N'MeasurementChecksum','CODE',10,'',NULL,NULL,NULL)
,(N'MeasurementLastChangeIDTrigger','CODE',20,'',NULL,NULL,NULL)
,(N'Measurements','TABL',1,'',NULL,NULL,NULL)
,(N'MeasurementSQL','CODE',10,'',NULL,NULL,NULL)
,(N'MeasurementStartJob','CODE',32,'',NULL,NULL,NULL)
,(N'MeasureRefreshMinutes','CONF',0,NULL,NULL,30.00000,NULL)
,(N'Measures','CODE',30,'',NULL,NULL,NULL)
,(N'MeasureViewPattern','CONF',0,NULL,N'measure[_]%',NULL,NULL)
,(N'Pack','CODE',100,'',NULL,NULL,NULL)
,(N'Unpack','CODE',0,'',NULL,NULL,NULL)
)Box(ObjectName,ObjectType,ObjectSequence,BinaryContent,TextContent,DecimalContent,DateContent)
SET @SQL =REPLACE(REPLACE((SELECT CAST(DECOMPRESS(BinaryContent) AS nvarchar(4000)) FROM #BoxTable WHERE ObjectName = 'Box'),'[$schema$]','['+@SchemaName+']'),'[$prefix$','['+@Prefix);
EXEC (@SQL);
SET @SQL ='INSERT INTO ['+@SchemaName+'].['+@Prefix+'Box] SELECT ObjectName,ObjectType,ObjectSequence,BinaryContent,TextContent,DecimalContent,CAST(DateContent AS datetimeoffset) FROM #BoxTable';
EXEC (@SQL);
SET @SQL =REPLACE(REPLACE((SELECT CAST(DECOMPRESS(BinaryContent) AS nvarchar(4000)) FROM #BoxTable WHERE ObjectName = 'Unpack'),'[$schema$]','['+@SchemaName+']'),'[$prefix$','['+@Prefix);
SET @SQL =REPLACE(REPLACE(@SQL,'[/$schema/$]','[$schema$]'),'[/$prefix/$','[$prefix$');
EXEC (@SQL);
SET @SQL ='EXEC ['+@SchemaName+'].['+@Prefix+'Unpack]'
EXEC (@SQL);